import 'bootstrap/dist/css/bootstrap.min.css';

export default function Display({message}){
    return(
        <div className="row">
            <div className="col-sm-2"></div>
            <div className="col-sm-8">
                <h1 className="display">{message}</h1>
            </div>
            <div className="col-sm-2"></div>
        </div>
    );
}
